import React, {useEffect,useRef} from 'react';
import Rellax from "rellax";
import './cv.css'
import { studentData } from './studentData';
import UserParams from './useParams';

const Cv = () => {
  let boolean = true
  const rellaxRef = useRef();
  let studentNamelocation
 const {name} = UserParams(boolean)



  useEffect(() => {
    new Rellax(rellaxRef.current, {
      speed: 4,
      center: false,
      wrapper: null,
      round: true,
      vertical: true,
      horizontal: false
    });


  }, []);
  return (
    <>
      {
        studentData.map((data,index) =>{
          const {studentName,resBackImg, frontImg,backImg} = data
          console.log(frontImg)
          if(studentName === name){
            studentNamelocation = studentName
            return(
              <div key={index} className="one">
                <img  src={backImg} alt="img" className='img1' />
                <img src={resBackImg} alt="img" className='img2' />
                <div className="front rellax">
                  <img src={frontImg} alt="img" useref={rellaxRef} />
                </div>

                <div className="map ">
                  <a  href="https://www.google.co.uk/maps/@40.3849248,49.8027824,19z">
                  Ünvana baxın
                  <span></span>
                  <span></span>
                  <span></span>
                  <span></span>
                  </a>
                </div>
              </div>
            )

          }
        })
      }
    </>
  );
};

export default Cv;
